import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      nn: '哈哈哈哈哈'
    }
  }
  render () {
    const { nn } = this.state;
    return (
      <div>{nn}</div>
    )
  }
}

export default App;
